// import React from 'react';
import './UserTable.css'; // CSS file for user table styling

const UserTable = ({ users, heading }) => {
  return (
    <div className="user-table-container">
      <h2>{heading}</h2> {/* Dynamically render the table heading */}
      <table className="user-table">
        <thead>
          <tr>
            <th>Name</th>
            <th>Email</th>
            <th>Number</th>
            <th>Profession</th>
            <th>Status</th>
            <th>Role</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {users.map((user, index) => (
            <tr key={index}>
              <td>{user.name}</td>
              <td>{user.email}</td>
              <td>{user.number}</td>
              <td>{user.profession}</td>
              <td>{user.status}</td>
              <td>{user.role}</td>
              <td>
                <button className="deactivate-btn">Deactivate</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default UserTable;
